import React from "react";
import "./Nav.css";

function Nav() {
  return (
    <div>
      <img
        src="https://www.edigitalagency.com.au/wp-content/uploads/Netflix-logo-red-black-png.png"
        alt=""
      />
      <h1>This is my Nav</h1>
    </div>
  );
}

export default Nav;
